import React, { Component } from 'react';
import "./Enemy.css";

class Enemy extends Component {
    render() {
        return (
            <div className="enemy-items__container">
                {this.props.enemyitems.map((item, index) =>
                    <img key={`enemy-items-${index}`} src={item.src} alt={item.name}/>
                )}
            </div>
        );
    }
}

export default Enemy;
